import "./rightbar.css";
import { Users } from "../../dummyData";
import Online from "../online/Online";

export default function Rightbar({ user }) {
  const PF = process.env.REACT_APP_PUBLIC_FOLDER;
  const HomeRightbar = () => {
    return (
      <>
        <div className="birthdayConatainer">
          <img src="assets/gift.png" alt="" className="birthdayImage" />
          <span className="birthdayText">
            {" "}
            <b>Pola Foster</b> and <b>3 other friends</b> have birthday today.
          </span>
        </div>
        <img className="rightbarAd" src="assets/ad.png" alt="" />
        <h4 className="rightbarTitle">Online Friends</h4>
        <ul className="rightbarFriendList">
          {Users.map((u) => (
            <Online key={u.id} user={u} />
          ))}
        </ul>
      </>
    );
  };

  const ProfileRightbar = () => {
    return (
      <>
        <h4 className="rightbarTitle">User information</h4>
        <div className="rightbarInfo">
          <div className="rightbarInfoItem">
            <span className="rightbarInfoKey">City:</span>
            <span className="rightbarInfoValue">{ user.city}</span>
          </div>
          <div className="rightbarInfoItem">
            <span className="rightbarInfoKey">From:</span>
            <span className="rightbarInfoValue">{ user.fr}</span>
          </div>
          <div className="rightbarInfoItem">
            <span className="rightbarInfoKey">Relationship:</span>
            <span className="rightbarInfoValue">Single</span>
          </div>
        </div>
        <h4 className="rightbarTitle">User friends</h4>
        <div className="rightbarFollowings">
          <div className="rightbarFollowing">
            <img src={ `${PF}person/1.jpeg`} className="rightbarFollowingImage" alt="" />
            <span className="rightbarFollowingName">John Cater</span>
          </div>
          <div className="rightbarFollowing">
            <img src={ `${PF}person/2.jpeg`} className="rightbarFollowingImage" alt="" />
            <span className="rightbarFollowingName">John Cater</span>
          </div>
          <div className="rightbarFollowing">
            <img src={ `${PF}person/3.jpeg`} className="rightbarFollowingImage" alt="" />
            <span className="rightbarFollowingName">John Cater</span>
          </div>
          <div className="rightbarFollowing">
            <img src={ `${PF}person/4.jpeg`} className="rightbarFollowingImage" alt="" />
            <span className="rightbarFollowingName">John Cater</span>
          </div>
          <div className="rightbarFollowing">
            <img src={ `${PF}person/5.jpeg`} className="rightbarFollowingImage" alt="" />
            <span className="rightbarFollowingName">John Cater</span>
          </div>
          <div className="rightbarFollowing">
            <img src={ `${PF}person/6.jpeg`} className="rightbarFollowingImage" alt="" />
            <span className="rightbarFollowingName">John Cater</span>
          </div>
        </div>
      </>
    );
  };
  return (
    <div className="rigthbar">
      <div className="rightbarWrapper">
        { profile ? <ProfileRightbar /> : <HomeRightbar /> }
      </div>
    </div>
  );
}
